import React , { useState, useEffect } from 'react';
import './OrderMng.css';
import OrderMngNav from './OrderMngNav.jsx';
import OrderMngTable from './OrderMngTable.jsx'
import CompletedOrders from './CompletedOrders.jsx'
import OrderHistory from './OrderHistory.jsx'
import ReactBootstrap, {Nav, Button, Navbar,NavDropdown,Table} from 'react-bootstrap';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
	
function OrderQ() {

		const [myData,setData] = useState([]);
		const [myArr,setArr] = useState(myData.map(() =>myArr.push("Accept/Reject")));


		useEffect(()=>{

			fetch("dummy.json").then(function(resp){
				return resp.json();
			})
			.then(function(data){
				if(data != myData){
					// for(let i=0;i<data.length;i++){
					// 	data[i]["statee"]="Accept"
					// }
					setData(...myData,data)

				}
			})
			.catch(err => {
	          // Do something for an error here
	          console.log("Error Reading data " + err);
		})
		},[]);

	
				
		const prepared = (idd) => {
			setData(myData.filter(user=>user.order_id!=idd))
		}
		
		return(
			<div className="tc">
				<Table responsive>
				  <thead>
				    <tr className="bg-light-silver tc ">
				      <th>DATE</th>
				      <th>ORDER ID</th>
				      <th>CUST_ID</th> 
				      <th>ADDRESS</th>
				      <th>DELIVERY ITEMS</th> 	
				      <th>QTY</th>
				      <th>TOTAL(PKR)</th>
				      <th>ORDER TYPE</th>
				      <th>ACTION</th>
				      <th>ORDER TRACKING</th>
				    </tr>
				  </thead>
				  <tbody>
				  	{myData.map(user=> (
				  		<tr className="tc">	
				  			<OrderMngTable data={user} prepared={prepared} />
				  		</tr>
				  	))}
				  </tbody>
				</Table>
			</div>
		)
		
}

